/**
 * @param {number[]} numbers
 * @param {number} target
 * @return {number[]}
 */
const twoSum = function(numbers, target) {
    let answerArray = [];

    for (let i = 0; i < numbers.length; i ++) {
        let numberDiff = target - numbers[i];
        let otherNumberIndex = binarySearch(numbers, numberDiff, i);

        if (otherNumberIndex) {
            answerArray.push(i + 1, otherNumberIndex + 1);
            return answerArray;
        }
    }
};

// Only return an index which isn't the same as the current index
function binarySearch(array, target, currentIndex) {
    // Can always safely start one to the right of the current index, as the array is sorted and we loop through from left to right
    // This removes any possibility of binary search returning duplicates
    let left = currentIndex + 1;
    let right = array.length - 1;
    let mid;

    while (left <= right) {
        mid = Math.floor((left + right) / 2);
        if (array[mid] === target) {
            return mid;
        } if (array[mid] < target) {
            left = mid + 1;
        } else {
            right = mid - 1;
        }
    }

    return null;
}

